import React from "react";
import { Link } from "react-router-dom";
import './Card.css';

export default function Card({name, image, temperament, weight, temperaments}){
    return (
        <div >                
            <p >{name}</p>
            <img
            src={image}
            alt='Image not found'
            width='240px'
            height='180px'
          />
            <h6>Temperamento: {temperament}{temperaments}</h6>
            <h6>{weight}(kg)</h6>
            <br/>

        </div>
    );
}
